import React, { useEffect, useState } from "react";
import "../../App.css";
import Header from "../../Components/Header/Header";
import DoctorIntro from "../../Components/DoctorIntro/DoctorIntro";
import DoctorBlock from "../../Components/DoctorBlock/DoctorBlock";
import TimeDropdown from "../../Components/TimeDropdown/TimeDropdown";
import AppointmentContainer from "../../Components/AppointmentContainer/AppointmentContainer";

const Appointments = (props, state) => {
  const [appointmentList, setAppointmentList] = useState(null);

  const { patient_id } = props.location.state;

  useEffect(() => {
    async function getAppointments() {
      let appointmentQuery = await fetch(`/get_appointments/${patient_id}/`);
      let appointments = await appointmentQuery.json();
      setAppointmentList(appointments);
      console.log(appointments);
    }

    getAppointments();
  }, []);

  return (
    <div className="App">
      <Header portal="Upcoming Appointments"></Header>
      <AppointmentContainer></AppointmentContainer>
    </div>
  );
};

export default Appointments;
